import React from "react";
import styled, { ThemeProvider } from "styled-components";
import { lightTheme, darkTheme } from "./theme";
import MainContainer from "./MainContainer";
import Nav from "./Nav";

const Root = styled.div`
  background: #000;
  height: 100%;
  display: flex;
  flex-direction: column;
`;

const App = () => (
  <Root>
    <Nav />
    <MainContainer />
  </Root>
);

export default App;
